==== $PTII/doc/test/docManager.tcl: ptiny/configuration.xml-6.1 Test docClassNameToURL
==== Contents of test case:

        # If this test fails under Travis, the the problem could be
        # that actors have been added to the repository, yet the
        # codeDoc*.jar files in
        # https://github.com/icyphy/ptII/releases/download/nightly/
        # have not been updated.  $PTII/.travis.yml has a deploy
        # section that should copy the jar files if PT_TRAVIS_DOCS ==
        # true.  Note that Travis no longer supports Oracle JDK 8 and
        # JDK 11 does not have backward compatible support for
        # javadoc, so travis is failing to update the download/nightly
        # directory.  Even if Travis updates the codeDoc.jar files,
        # then under JDK 11 the actor index files will not be present
        # because JDK 11 is missing javadoc backward compatibility.

        # One possible fix is to build the jar files under JDK 8 with
        # (cd $PTII/doc; make install)
        # Then upload codeDoc.jar to the nightly release.
        # 1. Go to https://github.com/icyphy/ptII/releases
        # 2. Find the nightly release
        # 3. Click on edit
        # 4. Delete the old codeDoc.jar
        # 5. Upload the new codeDoc.jar
        # For details, see 
        # https://docs.github.com/en/github/administering-a-repository/managing-releases-in-a-repository

	# In general, if we call getName on a public field in an actor,
	# then the name that is returned should be the same as the name
	# of the field.
	set entityList [$configuration allAtomicEntityList]
	set results {}
	for {set iterator [$entityList iterator]}  {[$iterator hasNext] == 1} {} {
		set entity [$iterator next]
		if [java::instanceof $entity ptolemy.actor.TypedAtomicActor] {
		    set actor [java::cast ptolemy.actor.TypedAtomicActor $entity]
		    set className [$actor getClassName]
		    set url [java::call ptolemy.vergil.actor.DocManager  docClassNameToURL  $configuration $className  true false false false]
		    if [java::isnull $url] {
			lappend results "\nFailed to find ptdoc for $className.  Try doing (cd $PTII/doc; rm codeDoc/ptolemy/actor/lib/Ramp.xml codeDoc/ptolemy/actor/lib/RampIdx.xml; make docs)"
		    }


		    set url [java::call ptolemy.vergil.actor.DocManager  docClassNameToURL  $configuration $className  false true false false]
		    if [java::isnull $url] {
			lappend results "\nFailed to find javadoc for $className"
		    }

		    set url [java::call ptolemy.vergil.actor.DocManager  docClassNameToURL  $configuration $className  false true false false]
		    if [java::isnull $url] {
			lappend results "\nFailed to find source for $className"
		    }


		    # For actor index, it is ok to return null
		    set url [java::call ptolemy.vergil.actor.DocManager  docClassNameToURL  $configuration $className  false false false true]
		}
	    }
    list $results	

